/*!

=========================================================
* Argon Dashboard React - v1.1.0
=========================================================

* Product Page: https://www.creative-tim.com/product/argon-dashboard-react
* Copyright 2019 Creative Tim (https://www.creative-tim.com)
* Licensed under MIT (https://github.com/creativetimofficial/argon-dashboard-react/blob/master/LICENSE.md)

* Coded by Creative Tim

=========================================================

* The above copyright notice and this permission notice shall be included in all copies or substantial portions of the Software.

*/
import Index from "views/Index.js";
import Profile from "views/examples/Profile.js";
import Maps from "views/examples/Maps.js";
import Register from "views/examples/Register.js";
import Login from "views/examples/Login.js";
import Tables from "views/examples/Tables.js";
import Icons from "views/examples/Icons.js";
import Airport from "views/examples/Airport.js";
import Shipment from "views/examples/Shipments/Shipment.js";
import ShipmentStep1 from "views/examples/Shipments/AddShipmentStep1";

var routes = [
  {
    path: "/index",
    name: "Inicio",
    icon: "fas fa-home text-gray-dark",
    component: Index,
    layout: "/admin",
    side: true,
  },
  {
    path: "/shipments",
    name: "Envíos",
    icon: "ni ni-send text-gray-dark",
    component: Shipment,
    layout: "/admin",
    side: true,
  },
  {
    path: "/clients",
    name: "Clientes",
    icon: "ni ni-single-02 text-gray-dark",
    component: Maps,
    layout: "/admin",
    side: true,
  },
  {
    path: "/storehouse",
    name: "Almacén",
    icon: "ni ni-bag-17 text-gray-dark",
    component: Profile,
    layout: "/admin",
    side: true,
  },
  {
    path: "/flights",
    name: "Vuelos",
    icon: "fas fa-ticket-alt text-gray-dark",
    component: Tables,
    layout: "/admin",
    side: true,
  },
  {
    path: "/airports",
    name: "Aeropuertos",
    icon: "fas fa-plane text-gray-dark",
    component: Airport,
    layout: "/admin",
    side: true,
  },
  {
    path: "/reports",
    name: "Reportes",
    icon: "fas fa-file-alt text-gray-dark",
    component: Tables,
    layout: "/admin",
    side: true,
  },
  {
    path: "/incidents",
    name: "Incidencias",
    icon: "fas fa-exclamation-triangle text-gray-dark",
    component: Tables,
    layout: "/admin",
    side: true,
  },
  {
    path: "/users",
    name: "Usuarios",
    icon: "ni ni-circle-08 text-gray-dark",
    component: Tables,
    layout: "/admin",
    side: true,
  },
  {
    path: "/login",
    name: "Login",
    icon: "ni ni-key-25 text-gray-dark",
    component: Login,
    layout: "/auth",
    side: true,
  },
  {
    path: "/register",
    name: "Register",
    icon: "ni ni-circle-08 text-gray-dark",
    component: Register,
    layout: "/auth",
    side: true,
  },
  {
    path: "/addShipmentStep1",
    name: "AddShipmentStep1",
    icon: "ni ni-circle-08 text-gray-dark",
    component: ShipmentStep1,
    layout: "/admin",
    side: false,
  },
];
export default routes;
